(162, 2, 2, 444, 0, '27/07/2016', 'TEST PREVENTIVO', 5, 'sadfasdf', '54', 'considerazioni', 'note importanti', '', 0, '11/11/2016', '31/07/2016', 3800.256, 0, 0, 0, 3200.267, 1, 1, '2016-07-28 15:54:55', '2016-07-28 15:54:55', 16, 1, 0),
(163, 1, 1, 0, 0, '29/07/2016', 'SITO WEB LANGA WEB - PACCHETTO %WEB', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il Sito Web a Tecnologia Dinamica con tutte le voci sopra elencate (a pacchetto finito). Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile. Nel prezzo e'' stato aggiunto un''optional di gestione news oltre al pacchetto %WEB. I prezzi del mantenimento sito web annuale (dal secondo anno) sono stati indicati a prezzo unitario ma calcolati sempre in un''ottica di servizio completo. Sezione Blog, Esecuzione foto HD, pagine web e loghi vettorializzati con annessi grafici ed elementi web visti durante il colloquio. Come consiglio sincero le comunico di fare SEMPRE Marketing Step by Step.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di Marketing senza definizione precisa di scatti, pagine o tempo di Assistenza.', '', 16, '15/11/2016', '20/11/2016', 6200, 10, 5, 0, 5300, 0, 0, '2016-07-29 13:00:31', '2016-07-29 13:00:31', 16, 0, 0),
(164, 1, 0, 0, 0, '16/08/2016', 'CALENDARIO DA TAVOLO A GRAFFA ORIZZONTALE', 2, 'MI SONO SEMBRATI A POSTO > BISOGNA INCON', 'A CONSEGNA MATERIALE', 'Il preventivo compilato comprende l''esecuzione digitale del calendario da tavolo richiesto. E'' stato preventivato un formato da tavolo non invasivo (piu'' attuale) al fine di ridurre l''ingombro dello stesso sul luogo d''appoggio (scrivania). La grafica e i file tecnici per la stampa sono compresi come forfait d''insieme al fine della creazione totale di Calendari 2017. Il preventivo :164/16 LANGA PRINT (linea fast sugli ordini del gestionale Easy LANGA) in quanto legato alla conferma del :163/16 LANGA WEB, su base tempo e sconti.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di Marketing senza definizione precisa di demo/immagini o tempo di Assistenza.', '', 6, '19/08/2016', '23/09/2016', 430, 5, 5, 0, 380, 0, 0, '2016-08-16 07:38:31', '2016-08-16 07:38:31', 16, 0, 10),
(165, 56, 56, 1507, 1709, '23/08/2016', 'SITO WEB RESPONSIVE - PACCHETTO WEB', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il sito web a tecnologia dinamica responsive con tutte le voci sopra elencate (a pacchetto finito). Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile.Nel prezzo e'' stato aggiunto un optional di gestione news automatizzata con l''optional VELOX SCRIPT. I prezzi del mantenimento sito web annuale (dal 2° anno) sono stati indicati a prezzo unitario ma calcolati sempre in un''ottica di servizio completo. Sezione blog, esecuzione foto HD,pagine web e loghi vettorializzati con annessi grafici ed elementi web osservati durante il colloquio.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di marketing senza definizione precisa di scatti, pagine o tempo di assistenza.', '', 13, '20/09/2016', '20/12/2016', 6900, 6, 5, 0, 6100, 0, 0, '2016-08-17 10:05:25', '2016-08-17 10:05:25', 16, 0, 0),
(166, 1, 0, 1508, 766, '23/08/2016', 'CALENDARIO CLASSICO DA APPENDERE A GRAFFA ORIZZONTALE', 2, 'MI SONO SEMBRATI A POSTO > BISOGNA INCON', 'A CONSEGNA MATERIALE', 'Il preventivo compilato comprende l''esecuzione digitale del calendario da parete richiesto. E'' stato preventivato il formato richiesto in colloquio. La grafica e i file tecnici per la stampa sono compresi come forfait d''insieme al fine della creazione totale di Calendari 2017. Il preventivo :166/16 LANGA PRINT e'' legato alla conferma del :163/16 LANGA WEB, su base tempo e sconti.', 'Per la conferma della nostra riuscita temporale in merito all''esecuzione tecnica dei preventivi abbiamo bisogno di mettere in lista Easy LANGA (gestionale interno) i progetti entro la settimana.', '', 5, '26/08/2016', '19/10/2016', 1250, 7, 5, 0, 1100, 0, 0, '2016-08-23 06:25:16', '2016-08-23 06:25:16', 16, 0, 0),
(167, 1, 1, 0, 0, '25/08/2016', 'GADGET PORTACHIAVI + FISCHIETTI LEVA', 2, '', 'A CONSEGNA MATERIALE', 'Il preventivo compilato comprende l''esecuzione digitale di tutte le sezioni intestate sopra nel preventivo.\r\n\r\nGrafica e materiale sono compresi a pacchetto completo. I fischietti bianchi sono stati resi in forma OMAGGIO da LANGA Group i in quantita'' minima di 100 pezzi.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di Marketing senza definizione precisa di demo/immagini o tempo di Assistenza (chiavi in mano)', '', 6, '28/08/2016', '08/09/16', 425, 5, 5, 0, 380, 0, 1, '2016-08-25 10:42:18', '2016-08-25 10:42:18', 16, 0, 0),
(168, 1, 0, 1525, 785, '30/08/2016', 'SITO WEB LANGA WEB - PACCHETTO %WEB', 1, 'parlato con Flavio Cravero (sembra un po'' Ing. Fornasero BMP) azienda che non ha mai pensato all''immagine, ma fatto giro aziendale tra le macchine e....complimenti (laser, presse, robots,...)', 'DA DEFINIRE', 'Il preventivo comprende il Sito Web a Tecnologia Dinamica con tutte le voci sopra elencate (chiavi in mano). Le sezioni non asteriscate sono eludibili e scorporabili, le altre no. Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile. Nel prezzo e'' stato aggiunto un''optional di gestione news oltre al pacchetto %WEB + codice implementato VELOX %SCRIPT per la pubblicazione sui Social direttamente dal blog/news del sito, I prezzi del mantenimento sito web annuale (dal secondo anno) sono stati indicati a prezzo unitario ma calcolati sempre in un''ottica di servizio completo. Sezione Blog, Esecuzione foto HD, pagine web e loghi vettorializzati con annessi grafici ed elementi web visti durante il colloquio. Preventivato nel pacchetto anche un canale FTP con alcune pagine chiuse sotto password (e.g. rivenditori/agenti).', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di Marketing senza definizione precisa di scatti, pagine o tempo di Assistenza.', '', 5, '14/09/2016', '23/12/2016', 9710, 10, 5, 0, 8300, 0, 0, '2016-08-26 10:36:11', '2016-08-26 10:36:11', 16, 0, 0),
