(188, 1, 0, 1571, 0, '17/10/2016', 'MODIFICHE LATO ADMIN WP - SITO THERMAEUROPE', 1, ' ', 'ANTICIPO TOTALE + CARTA A GARANZIA PER RINNOVI', 'Il preventivo comprende le modifiche ed integrazioni relative al il Sito Web a Tecnologia Dinamica ThermaEurope con tutte le voci sopra elencate al prezzo di costo compensato dal documento in allegato. Logicamente le modifiche e le integrazioni specificate sulle sezioni del preventivo avranno effetto similare sulla base delle richieste (il motivo e'' che partendo da un template WP lavorato da altri sviluppatori potremmo incappare in limitazioni). Il costo di rinnovo e'' imputato al proprietario del dominio e avverra'' dopo 1 anno dalla registrazione al costo di 600.00eu/anno (relativi upgrade di server con relativi costi aggiuntivi da valutarsi). Garantiremo la fattibilita'' delle richieste con vostra elasticita'' mentale sulle modifiche di layout da eseguirsi sulla piattaforma in oggetto di preventivo. Al preventivo allego documento contrattuale di compensazione su base % di guadagno temporale relativo alla piattaforma ecommerce www.thermaeurope.com (DOC :#188/16).', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione professionale completa di Web Marketing per start della matrice.', '', 13, '20/10/2016', '19/01/2017', 3100, 10, 5, 0, 2500, 1, 1, '2016-10-17 09:15:08', '2016-10-17 09:15:08', 16, 0, 0),
