(190, 1, 1, 1582, 1346, '24/10/2016', '3 VETROFANIE - CIDIMU', 2, '', 'A CONSEGNA MATERIALE', 'Il preventivo comprende il Marketing Grafico intestato nelle sezioni elencate sopra con\r\ngrafica chiavi in mano. Per la lavorazione servono alcune ore ai grafici per creare file tecnico per la stampa con linee e curve proposte negli allegati (al fine del taglio a sagomatura). Stampa/grafica e montaggio incluse nel totale dovuto mostrato.\r\n', 'Consegna lavoro grafico chiavi in mano: file tecnici/stampa e montaggio entro data termine presunto. I tecnici la contatteranno direttamente per la posa entro la data citata affianco.', '', 7, '26/10/2016', '10/11/2016', 370, 10, 0, 333, 330, 1, 1, '2016-10-24 10:32:12', '2016-10-24 10:32:12', 16, 0, 0),
(191, 1, 1, 1576, 1625, '28/10/2016', 'GESTIONALE %TREE (MODULI ORIZZONTALI + ADD-ON WHOLE)', 1, '', 'Sistema PagOnline Unicredit', 'Nel preventivo si tiene conto dei moduli asteriscati richiesti (enti/calendario/contabilita'') altri elencati che potrebbero interessare a qualche cliente a cui verra'' sottoposto sono stati mostrati con il prezzo in aggiunta affiancato. Sconto applicato del 5%+5% sull''acquisto totale del pacchetto GESTIONALE %TREE. In caso di scelta totale (no WHOLE) del le sezioni indicate lo sconto massimo viene fissato al 10%+5% sul prezzo totale. (MODULO TREE %BATCALENDAR non eludibile per le vendite relative al gestionale). Per l''attivita'' di promozione sara'' corrisposta una % sul venduto da definirsi.', 'Il prezzo del preventivo tiene conto di un''installazione di moduli orizzontali finiti del GESTIONALE %TREE programmati su un prodotto gia'' testato sul sistema Easy ', '', 16, '22/11/2016', '31/03/2017', 1480, 5, 5, 1335.7, 1330, 0, 0, '2016-10-25 13:09:57', '2016-10-25 13:09:57', 16, 0, 0),
