(194, 1, 0, 1582, 1758, '28/10/2016', 'SERVIZIO FOTOGRAFICO PRO + POSTPRODUZIONE', 1, '', 'A CONSEGNA MATERIALE', 'Il preventivo comprende il Marketing Grafico intestato nelle sezioni elencate sopra con\r\ngrafica chiavi in mano. La divisione a lei interessante fa parte del Gruppo LANGA, stavolta pero'' LANGA WEB (ambito solo digitale). Considerate 20 tagli fotografici e convocazione fotografo. (per 6 fotografie diventa difficile far muovere un fotografo professionista con relativo parco macchine, per questo le vengono proposti 20 tagli + relativa postproduzione in studio) Queste fotografie saranno utilizzabili lato web, cartaceo e/o sliding video comprensivi di diritti totali di copyright. Considerata Urgenza con ponte/ferie personale nella settimana del 1 novembre.', 'Consegna lavoro con relativa postproduzione entro la settimana del 31/10/2016.', '', 6, '28/10/2016', '04/11/2016', 620, 5, 5, 559.55, 550, 0, 0, '2016-10-28 12:03:35', '2016-10-28 12:03:35', 16, 0, 0),
