(196, 56, 56, 1586, 0, '03/11/2016', 'SITO WEB RESPONSIVE_PACCHETTO ONE', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il sito  % ONE a tecnologia dinamica responsive con tutte le voci elencate(a pacchetto finito). Sara'' visualizzabile su dispositivi mobili. Come precisato in sede di colloquio che la matrice del sito sara'' ampliabile in qualsiasi momento. E'' stato conteggiato nel preventivo la creazione di una pagina ''''aziendale'''' social network(fb)', 'Il mantenimento annuale e'' gia'' compreso per il 1 anno e il  rinnovo sara'' dal 2 anno (REGISTRAZIONE %SERVER = rinnovo dominio + hosting + pulizia DB ). ', '', 0, '15/11/2016', '30/01/2017', 3420, 7, 6, 2989.764, 2950, 0, 0, '2016-11-03 10:06:40', '2016-11-03 10:06:40', 16, 0, 0),
(197, 1, 1, 1590, 1678, '04/11/2016', 'SITO WEB DINAMICO RESPONSIVE_PACCHETTO ONE', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il Sito Web a Tecnologia Dinamica con tutte le voci sopra\r\nelencate (a pacchetto finito). Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile. Nel prezzo e'' stato aggiunto un''optional di gestione news oltre al pacchetto %ONE. I prezzi del mantenimento sito web annuale (dal secondo anno) sono stati indicati a prezzo unitario ma calcolati sempre in un''ottica di servizio completo. Sezione Blog, Esecuzione foto HD, pagine web e loghi vettorializzati con annessi grafici ed elementi web visti durante il colloquio. Come consiglio sincero le comunico di fare SEMPRE Marketing Step by Step (ma ben programmato e non in visuale). Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di Marketing senza definizione precisa di scatti, pagine o tempo di Assistenza.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di Marketing\r\nsenza definizione precisa di scatti, pagine o tempo di Assistenza', '', 15, '11/11/2016', '31/01/2017', 4150, 10, 5, 3548.25, 3500, 0, 0, '2016-11-03 10:21:17', '2016-11-03 10:21:17', 16, 0, 0),
(198, 1, 0, 1229, 1561, '04/11/2016', 'SITO WEB LANGA WEB - PACCHETTO %WEB', 1, ' ', 'DA DEFINIRE', 'Il preventivo comprende il Sito Web a Tecnologia Dinamica con tutte le voci sopra elencate (a pacchetto finito). Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile. Nel prezzo e'' stato aggiunto un''optional di gestione news oltre al pacchetto %WEB. I prezzi del mantenimento server/sito web annuale (dal secondo anno) sono stati indicati a prezzo unitario ma calcolati sempre in un''ottica di servizio completo. Sezione Blog, Esecuzione foto HD, pagine web e loghi vettorializzati con annessi grafici ed elementi web visti durante il colloquio. Come consiglio sincero le comunico di fare SEMPRE Marketing Step by Step. Considerato VELOX %SCRIPT LANGA per allaccio sito ai social aziendali.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di Marketing senza definizione precisa di scatti, pagine o tempo di Assistenza.', '', 13, '18/11/2016', '15/02/2017', 5300, 8, 8, 4485.92, 4450, 0, 0, '2016-11-03 11:56:21', '2016-11-03 11:56:21', 16, 0, 0),
