(217, 53, 53, 1615, 2034, '29/11/2016', 'INTERVENTO WEB MARKETIG (SITO WEB RESPONSIVE)', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il Sito Web a Tecnologia Dinamica con tutte le voci sopra\r\nelencate (chiavi in mano). Le sezioni non asteriscate sono eludibili e scorporabili, le altre no. Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile. Nel prezzo e'' stato aggiunto un''optional di gestione news oltre al pacchetto %WEB. (no velox per non aumentare troppo il costo iniziale) REGISTRAZIONE %SERVER sito web annuale. (dal secondo anno) Sezione Blog, Esecuzione foto HD, pagine web e loghi vettorializzati con annessi grafici ed elementi web visti a colloquio. Applicata scontistica maggiorata di 9+7 nel caso venisse chiuso insieme al preventivo :216/16. Da considerarsi standard 6+7 se chiuso singolarmente, come suggerito da gestionale Easy LANGA in base al totale.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di Marketing\r\nsenza definizione precisa di scatti, pagine o tempo di Assistenza.', '', 11, '12/01/2017', '28/04/2017', 5860, 9, 7, 4959.318, 4950, 0, 0, '2016-11-24 15:05:38', '2016-11-24 15:05:38', 16, 0, 0),
(218, 1, 1, 225, 1834, '29/11/2016', 'CURA SOCIAL', 1, '', 'DA DEFINIRE', 'Creazione impianti Social per la cantina inerente sulla base dei discorsi tra Federico e me (non relativi ai mi piace ma ad un''espansione futura della notizia). Logicamente, come ripeto sempre, non posso garantire un risultato certo, quello che posso darvi e'' un buon indirizzo sulla strada giusta (considera che lo facciamo anche per la nostra societa''). Il preventivo comprende la cura dei social tramite strumenti d''ufficio in remoto; si potra'' parlare del piu'' e del meno al fine da creare movimento d''interesse. Il cliente deve vedere un movimento della cantina sempre in attivo senza promuovere quasi mai niente.', 'Spero di portarvi sempre piu'' risultati al fine di portarne sempre piu'' anche a me. Quando ho proposto un sito per la cantina non ho dato certezze di ritorno ma penso sia stato un giusto investimento.', '', 0, '02/12/2016', '02/12/2017', 2529, 8, 5, 2211.22, 2200, 1, 1, '2016-11-29 17:04:26', '2016-11-29 17:04:26', 16, 0, 0);
