(219, 1, 0, 1617, 0, '02/12/2016', '2 VETROFANIE RETTANGOLARI + 1 A SAGOMA (INTERNE)', 2, '', 'A CONSEGNA MATERIALE', 'Il preventivo comprende il Marketing Grafico intestato nelle sezioni elencate sopra con\r\ngrafica chiavi in mano. Linee e curve basate sul file inviatoci ma rivisitate per farsi'' che il lavoro di sagomatura non si deformi in punti troppo sottili. Stampa/grafica e montaggio incluse nel totale dovuto mostrato. Come da vostre richieste indico che due file sono a rettangolo intero applicato nella parte bassa + uno a logo sopra a rettangolo piu'' grande.', 'Consegna lavoro grafico chiavi in mano: file tecnici/stampa e montaggio entro data termine presunto. Omaggio urgenza nell''applicazione di montaggio interno delle 3 vetrofanie richieste.', '', 5, '02/12/2016', '07/12/2016', 414, 5, 2, 385.434, 380, 0, 0, '2016-12-02 09:00:14', '2016-12-02 09:00:14', 16, 0, 0),
(220, 1, 0, 1616, 0, '02/12/2016', 'INTERVENTO WEB MARKETIG (SITO WEB RESPONSIVE)', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il Sito Web a Tecnologia Dinamica con tutte le voci sopra\r\nelencate (a pacchetto finito). Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile. Nel prezzo e'' stato aggiunto un''optional di gestione news oltre al pacchetto %WEB. REGISTRAZIONE %SERVER sito web annuale, dal secondo anno. Sezione Blog, Esecuzione foto HD, pagine web e loghi vettorializzati con annessi grafici ed elementi web visti durante il colloquio. Velox Script per gestione veloce notizie aggiunto come optional al pacchetto, quindi eludibile e applicabile in un secondo momento.', 'Come consiglio sincero le comunico di fare SEMPRE Marketing Step by Step. Matrici di programmazione sempre espandibili ed implementabili.', '', 11, '15/12/2016', '17/03/2017', 6880, 10, 4, 5944.32, 5900, 0, 0, '2016-12-02 13:09:31', '2016-12-02 13:09:31', 16, 0, 0),
(221, 1, 1, 225, 0, '02/12/2016', 'ETICHETTE CARTA COLLA', 2, '', 'DA DEFINIRE', 'Il preventivo comprende il Marketing Grafico intestato nelle sezioni elencate sopra con file tecnici rielaborati per stampa (crocini di taglio e posizione). Ho tenuto piu'' basso che potevo il prezzo a costo unitario al fine di cercare di portare via il preventivo e iniziare una collaborazione anche il discorso print. I nostri partner hanno visti l''etichetta e hanno detto che la stampa puo'' migliorare nettamente con loro lavorazioni. Logicamente ti garantisco che il nostro lavoro e'' molto serio e fatto a regola d''arte.', 'Considera sempre un lavoro fatto e finito in modo completo su tutti i punti di vista (sottolineo solo il fatto di non mi chiedere mai di stampare oggi per domani, che finiamo solo di fare un lavoraccio e poi non siamo soddisfatti ne voi ne noi)', '', 7, '02/12/2016', '31/01/2017', 2250, 8, 5, 1966.5, 1950, 0, 0, '2016-12-02 17:11:43', '2016-12-02 17:11:43', 16, 0, 0),
(222, 56, 56, 1566, 0, '09/12/2016', 'SITO WEB RESPONSIVE_PACCHETTO ONE', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il sito  % ONE a tecnologia dinamica responsive con tutte le voci elencate(a pacchetto finito). Sara'' visualizzabile su dispositivi mobili. Come precisato in sede di colloquio che la matrice del sito sara'' ampliabile in qualsiasi momento. E'' stato conteggiato nel preventivo la creazione di una pagina ''''aziendale'''' social network(fb)', 'Il mantenimento annuale e'' gia'' compreso per il 1 anno e il  rinnovo sara'' dal 2 anno (REGISTRAZIONE %SERVER = rinnovo dominio + hosting + pulizia DB ).', '', 0, '20/12/2016', '15/03/2017', 3420, 7, 6, 2989.764, 2950, 0, 0, '2016-12-09 14:49:23', '2016-12-09 14:49:23', 16, 0, 0),
(223, 1, 0, 1622, 1887, '12/12/2016', '2 VIDEO AZIENDALI PER PUBBLICITA'' ESCAPE ROOM', 3, 'MANDATO VIDEO LINK KRAMP https://www.youtube.com/user/krampgroep', '50%ACCONTO + 50%CONSEGNA', 'Nel preventivo tengo conto di una creazione di 2 video semplici a template che possano rappresentare l''attivita'' in modo fittizio (no riprese c/o loco ma frame da web). Sono compresi studi ed inserimenti grafici di scritte  Typography per corredo video aziendale Phobos con movimenti ed effetti a remoto (come, glitch, sliding, ballerine e/o innalzamenti a gru fittizi). Le ho tenuto prezzi al minimo storico, sperando che come detto al telefono si possa continuare una collaborazione futura magari anche lato web.', 'Storyboard con oggetto di rappresentazione vendita Phobos (azienda, simili a link video da Lei inviati) e non prodotto specifico (loco).', '', 17, '13/12/2016', '19/12/2016', 1080, 6, 4, 974.592, 970, 0, 0, '2016-12-10 20:09:10', '2016-12-10 20:09:10', 16, 0, 0),
