(228, 1, 0, 225, 0, '02/12/2016', 'ETICHETTE CARTA ADESIVA IN BOBINA', 2, '', 'DA DEFINIRE', 'Il preventivo comprende il Marketing Grafico intestato nelle sezioni elencate sopra con file tecnici rielaborati per stampa in bobina. Rivale il discorso "Ho tenuto piu'' basso che potevo il prezzo a costo unitario al fine di cercare di portare via il preventivo e iniziare una collaborazione anche il discorso print." Garantiamo etichette migliorative con carta come da te richiesta. Logicamente ti garantisco che il nostro lavoro e'' molto serio e fatto a regola d''arte. Quantita'' indicata su base anno per poter raggiungere un prezzo piu'' basso. Costo punzone ribassato, costo effettivo di 0,086 con punzone.', 'Considera sempre un lavoro fatto e finito in modo completo su tutti i punti di vista (sottolineo solo il fatto di non mi chiedere mai di stampare oggi per domani). Data fine lavori indicativa, se procediamo ci mettiamo daccordo su date piu'' precise di consegna.', '', 6, '28/02/2017', '31/05/2017', 9100, 3, 2, 8650.46, 8600, 0, 0, '2017-01-06 11:04:20', '2017-01-06 11:04:20', 17, 0, 0),
