(237, 56, 56, 1594, 0, '19/01/2017', 'SITO WEB RESPONSIVE + CURA E CREAZIONE SOCIAL', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il sito web a tecnologia dinamica responsive con tutte le voci sopra elencate (a pacchetto finito). Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile.Nel prezzo    è stato aggiunto un optional di gestione news automatizzata con l''optional VELOX SCRIPT e la CURA SOCIAL per 3 volte a settimana.I prezzi del mantenimento sito web annuale (dal 2 anno) sono stati indicati a prezzo unitario ma calcolati sempre in un''ottica di servizio completo. Sezione blog, esecuzione foto HD,pagine web e loghi vettorializzati con annessi grafici ed elementi web osservati durante il colloquio.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di marketing senza definizione precisa di scatti, pagine o tempo di assistenza.', '', 10, '07/02/2017', '10/05/2017', 10180, 10, 7, 8520.66, 8500, 0, 0, '2017-01-18 15:42:52', '2017-01-18 15:42:52', 17, 0, 0),
(238, 56, 56, 1594, 2086, '19/01/2017', 'CREAZIONE E CURA SOCIAL NETWORK', 1, '', 'DA DEFINIRE', 'Il preventivo comprende la creazione e la cura dei principali social  network aziendali.\r\n\r\n\r\n', 'Ricordiamo che il preventivo e'' calcolato su una valenza mensile e con totale annuale.\r\n\r\n\r\n', '', 9, '30/01/2017', '27/02/2017', 3480, 5, 5, 3140.7, 3100, 0, 0, '2017-01-18 15:52:47', '2017-01-18 15:52:47', 17, 0, 0),
(239, 1, 0, 1632, 2094, '27/01/2017', 'SITO WEB RESPONSIVE_PACCHETTO WEB', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il sito web a tecnologia dinamica responsive con tutte le voci sopra elencate (a pacchetto finito). Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile.Nel prezzo e'' stato aggiunto un optional di gestione news automatizzata con l''optional VELOX SCRIPT. I prezzi del mantenimento sito web annuale (dal 2 anno) sono stati indicati a prezzo unitario ma calcolati sempre in un''ottica di servizio completo. Sezione blog, esecuzione foto HD,pagine web e loghi vettorializzati con annessi grafici ed elementi web osservati durante il colloquio.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di marketing senza definizione precisa di scatti, pagine o tempo di assistenza.', '', 9, '02/02/2017', '10/05/2017', 6880, 7, 7, 5950.512, 5950, 0, 0, '2017-01-25 17:57:59', '2017-01-25 17:57:59', 17, 0, 0),
(240, 1, 0, 1632, 2095, '27/01/2017', 'SITO WEB RESPONSIVE + CURA E CREAZIONE SOCIAL', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il sito web a tecnologia dinamica responsive con tutte le voci sopra elencate (a pacchetto finito). Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile. Nel prezzo    e'' stato aggiunto un optional di gestione news automatizzata con l''optional VELOX SCRIPT e la CURA SOCIAL per 3 volte a settimana.I prezzi del mantenimento sito web annuale (dal 2 anno) sono stati indicati a prezzo unitario ma calcolati sempre in un''ottica di servizio completo. Sezione blog, esecuzione foto HD,pagine web e loghi vettorializzati con annessi grafici ed elementi web osservati durante il colloquio. Il piano editoriale di cura startera'' sull''impianto programmato.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di marketing senza definizione precisa di scatti, pagine o tempo di assistenza.', '', 10, '02/02/2017', '10/05/2017', 10180, 10, 7, 8520.66, 8500, 0, 0, '2017-01-25 18:02:21', '2017-01-25 18:02:21', 17, 0, 0),
(241, 1, 0, 1632, 2096, '27/01/2017', 'INTERVENTO WEB MARKETING | PACCHETTO %WEB + OPTIONAL', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il Sito Web a Tecnologia Dinamica con tutte le voci sopra elencate (chiavi in mano). Le sezioni non asteriscate sono eludibili e scorporabili, le altre no. Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile. Nel prezzo sono stati aggiunti optional di gestione oltre al pacchetto %WEB + codice implementato VELOX %SCRIPT per la pubblicazione sui Social direttamente dal blog/news del sito. Sottolineo che e'' un lavoro che privilegia la codificazione ad impianto e non i piu'' semplici mezzi di aiuto di startup come AdWords (di questo intervento se ne potra'' parlare dopo aver strutturato una corretta impronta di marketing) Preventivato un lavoro di codifica e di immagine annessa con esecuzione di immagini/elementi FULL HD/vettoriali e/o raster, pagine, annessi grafici ed elementi web.', 'Ricordo che questa e'' una creazione completa di Web Marketing. Sottolineo che l''assistenza LANGA e'' sempre valida verso la clientela che ha servizi di registrazione. (no costi tecnici di assistenza con consigli continui sugli aggiornamenti web)', '', 14, '02/02/2017', '28/07/2017', 27495, 8, 4, 24283.584, 24200, 0, 0, '2017-01-25 18:03:20', '2017-01-25 18:03:20', 17, 0, 0),
(242, 1, 0, 1632, 2097, '27/01/2017', 'VIDEO AZIENDALE', 3, 'MANDATO VIDEO LINK KRAMP https://www.youtube.com/user/krampgroep', 'DA DEFINIRE', 'Nel preventivo tengo conto di una creazione video semplice e professionale che possa rappresentare l''azienda (no riprese a drone ma inserimenti piu'' professionali tramite utilizzo di stady e fly cam). Sono compresi studi ed inserimenti grafici di scritte  Typography per spiegazione video aziendale Delizie Bakery e riprese con strumenti a terra (sliding, ballerine e gru ove possibile di studi/dettagli e produzione). Considerati inserimenti web da parte della divisione LANGA WEB. Viene considerato un buon video che rappresenti l''azienda e il suo processo produttivo (uffici > produzione).', 'Storyboard con oggetto di rappresentazione azienda e non prodotto specifico. Diritti Copyright di riutilizzo gia'' inseriti nel preventivo.', '', 16, '03/02/2017', '05/04/2017', 4550, 8, 5, 3976.7, 3950, 0, 0, '2017-01-26 07:51:19', '2017-01-26 07:51:19', 17, 0, 0),
(243, 1, 0, 1600, 2103, '31/01/2017', 'SITO WEB RESPONSIVE_PACCHETTO WEB', 1, '', 'DA DEFINIRE', 'Il preventivo comprende il sito web a tecnologia dinamica responsive con tutte le voci sopra elencate (a pacchetto finito). Esso sara'' visualizzabile su qualsiasi tipologia di dispositivo mobile.Nel prezzo e'' stato aggiunto un optional di gestione news automatizzata con l''optional VELOX SCRIPT. Mantenimento sito web annuale (dal 2 anno) sono stati indicati a prezzo unitario ma calcolati sempre in ottica di servizio completo. Sezione blog, esecuzione foto HD, pagine web e loghi vettorializzati con annessi grafici ed elementi web osservati durante il colloquio. Considerato inserimenti video in layout + possibilita'' di inserirli da Easy User tramite gestionale backend per inserimenti media/post.', 'Ricordiamo che il prezzo del preventivo tiene conto di una creazione completa di marketing senza definizione precisa di scatti, pagine o tempo di assistenza.', '', 6, '09/02/2017', '05/05/2017', 7380, 7, 7, 6382.96, 6350, 0, 0, '2017-01-30 18:08:42', '2017-01-30 18:08:42', 17, 0, 0),
(244, 1, 1, 1600, 2104, '31/01/2017', 'REFRESH MEDIA JS_SITO WEB LANGA', 1, '', 'DA DEFINIRE', 'Con questo preventivo vi elenco i possibili optional che fanno parte della divisione LANGA WEB  e che ad oggi curano molti dei nostri clienti durante l''anno. Tramite questi optional, che differiscono solamente per frequenza di aggiornamento, si riuscira'' ad avere un sito con un nuovo taglio di layout. In poche parole avrete un reparto apposito dedicato capace di trasformar/integrare il vostro sito web tramite aggiornamenti applicativi in scrittura Js.', 'Le sezioni non sono da sommare ma vengono indicate mostrando la frequenza quantitava sull''anno. Questo non rappresenta un vero e proprio preventivo ma serve ad illustrare le possibilita'' di aggiornamento gestionale della vostra matrice web. Mancano gli applicativi di sconto per ogni sezione indicata. Gestionale "Easy LANGA" conferma sconto max di 6% + 5%.', '', 5, '09/02/2017', '15/06/2017', 0, 0, 0, 0, 0, 0, 0, '2017-01-30 18:37:54', '2017-01-30 18:37:54', 17, 0, 0),
